INSERT INTO `category_ticket` VALUES (13,7,'VIP','VIP',100000.00,5,'ACTIVE'),(14,7,'STANDARD','Standard ',50000.00,45,'ACTIVE'),(15,8,'VIP','VIP',20000.00,30,'ACTIVE'),(16,8,'STANDARD','Standard ',10000.00,20,'ACTIVE'),(19,10,'VIP','IGHG',3999999.00,10,'ACTIVE'),(20,10,'STANDARD','FFF',12000.00,30,'ACTIVE'),(21,17,'VIP','Vé VIP bao gồm quyền ngồi hàng ghế đầu, tài liệu chuyên sâu nâng cao về xây dựng chatbot AI, voucher giảm 30% khóa học AI nâng cao, giấy chứng nhận VIP và cơ hội networking riêng với diễn giả sau sự kiện.',200000.00,30,'INACTIVE'),(22,17,'STANDARD','Tham dự workshop, nhận tài liệu cơ bản, tham gia thực hành xây dựng chatbot và nhận chứng nhận tham dự.',120000.00,30,'INACTIVE'),(23,16,'VIP','Bao gồm chỗ ngồi ưu tiên, tài liệu nâng cao về Python + AI (file PDF), 1 giờ mentoring online sau workshop, giấy chứng nhận VIP, và bộ notebook code mẫu độc quyền.',95000.00,10,'ACTIVE'),(24,16,'STANDARD','Tham dự workshop, nhận tài liệu cơ bản, tham gia thực hành viết Python và mô hình ML đơn giản, nhận chứng nhận tham dự.',50000.00,30,'ACTIVE'),(25,15,'VIP','Bao gồm quyền tham gia khu vực networking riêng với chuyên gia HR & Tech Recruiter, gói phân tích CV chi tiết, mock interview 1:1 miễn phí sau sự kiện, tài liệu hướng nghiệp nâng cao.',125000.00,10,'INACTIVE'),(26,15,'STANDARD','Tham dự hội thảo, được nghe chia sẻ từ các chuyên gia tuyển dụng, tham gia các phiên hỏi đáp, nhận bộ tài liệu \"IT Career Handbook 2026\".',100000.00,40,'INACTIVE'),(27,14,'VIP','Bao gồm chỗ ngồi ưu tiên, tài liệu Masterbook chuyên sâu, video khóa học “Art of Presentation”, 1 buổi coaching cá nhân 30 phút sau workshop, chứng nhận VIP.',30000.00,20,'INACTIVE'),(1021,1014,'VIP','Ngồi hàng đầu dễ dàng xem tranh, giao lưu với host',35000.00,40,'ACTIVE'),(1022,1014,'STANDARD','Ngồi ở vị trí xa khó quan sát được tranh',20000.00,40,'ACTIVE'),(1061,1028,'VIP','Ghế ngồi hàng đầu\nTài liệu workshop đầy đủ (PDF + source code)\nĐược hỏi đáp trực tiếp với diễn giả\nChứng nhận tham gia (Certificate)',200000.00,20,'ACTIVE'),(1062,1028,'STANDARD','Tham gia toàn bộ workshop\nTài liệu học tập cơ bản\nHỏi đáp chung cuối chương trình',140000.00,40,'ACTIVE'),(1063,1029,'VIP','Vé VIP bao gồm quyền ngồi hàng ghế đầu, tài liệu chuyên sâu nâng cao về các công nghệ mới như machine learning, và cơ hội networking riêng với diễn giả sau sự kiện.\n',1500000.00,20,'ACTIVE'),(1064,1029,'STANDARD','\nTham dự workshop, nhận tài liệu cơ bản.',100000.00,30,'ACTIVE'),(1065,1032,'VIP','Giá vé VIP\n',250000.00,30,'ACTIVE'),(1066,1032,'STANDARD','Giá vé STANDARD',150000.00,70,'ACTIVE'),(1067,1030,'VIP','Giá vé VIP\n',150000.00,100,'ACTIVE'),(1068,1030,'STANDARD','Giá vé STANDARD',50000.00,200,'ACTIVE'),(1069,1031,'VIP','VIP tickets\n',250000.00,10,'ACTIVE'),(1070,1031,'STANDARD','STANDARD tickets',150000.00,10,'ACTIVE'),(1073,1039,'STANDARD','Giá vé STANDARD',50000.00,60,'ACTIVE'),(1074,1039,'VIP','Giá vé VIP',150000.00,30,'ACTIVE'),(1101,1041,'VIP','Giá vé VIP',300000.00,50,'ACTIVE'),(1102,1041,'STANDARD','Giá vé STANDARD',99998.00,250,'ACTIVE'),(1111,1047,'STANDARD','Giá vé STANDARD',50000.00,100,'ACTIVE'),(1112,1047,'VIP','Giá vé VIP',200000.00,50,'ACTIVE');
