INSERT INTO `speaker` VALUES (8,'Nguyễn Võ Minh Châu','','long@email.com','0373253725',NULL),(9,'Nguyễn Võ Minh Châu','','long@email.com','0373253725',NULL),(10,'Châu','ffddd','chau@gmail.com','09123456',NULL),(11,'bui ti duc','hfhf','hghd@gmail.com','012345689',''),(12,'Nguyễn Trọng Duy','Chuyên gia AI với hơn 8 năm kinh nghiệm trong lĩnh vực Natural Language Processing (NLP), Generative AI và xây dựng hệ thống Chatbot sử dụng LLM. Từng làm việc tại các công ty công nghệ lớn như FPT Software và Got It. Hiện đang là Technical Lead tại AI Vietnam Lab, phụ trách phát triển các mô hình đa ngôn ngữ và triển khai chatbot trong doanh nghiệp.','duy@gmail.com','0933307646','https://nguoinoitieng.tv/images/nnt/101/1/bfr0.jpg'),(13,'Trần Minh Khoa','Giảng viên và kỹ sư Machine Learning với hơn 6 năm kinh nghiệm trong xử lý dữ liệu, xây dựng mô hình AI và phát triển ứng dụng bằng Python. Từng làm việc tại VNG AI Team và hiện là Data Scientist tại LeapTech. Chuyên về nền tảng Python, scikit-learn, TensorFlow và triển khai mô hình AI thực tế cho doanh nghiệp.','minh.khoa.ds.tech@gmail.com','0932 557 124','https://nguoinoitieng.tv/images/nnt/0/2/mv.jpg'),(14,'Lê Quang Huy','Chuyên gia nhân sự cấp cao với hơn 10 năm kinh nghiệm trong tuyển dụng và xây dựng lộ trình nghề nghiệp trong lĩnh vực CNTT. Từng giữ vị trí Talent Acquisition Manager tại VNG và KMS Technology. Hiện đang là Head of Recruitment tại GlobalTech HR Hub, phụ trách tuyển dụng các vị trí Software Engineer, DevOps, AI Engineer và Product Manager.','huy.le.globaltech.hr@gmail.com','0911 864 739','https://nguoinoitieng.tv/images/nnt/1/0/am5.jpg'),(17,'Huỳnh Minh Thuận ','Chuyên gia đào tạo kỹ năng mềm với hơn 9 năm kinh nghiệm trong lĩnh vực thuyết trình, giao tiếp và phát triển cá nhân. Từng huấn luyện cho hơn 30 doanh nghiệp lớn như Viettel, MWG, FPT Telecom. Là Founder của “Present Mastery Academy” — học viện đào tạo kỹ năng thuyết trình được hơn 15.000 học viên theo học.','huynhminhthuan@gmail.com','0912345677','ht