CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_CloseExpiredEvents_CascadeAll`()
BEGIN
    DECLARE v_now DATETIME(6);
    SET v_now = NOW(6);

    -- Xóa bảng tạm nếu đã tồn tại trước khi tạo mới
    DROP TEMPORARY TABLE IF EXISTS ExpiredEvents;

    CREATE TEMPORARY TABLE ExpiredEvents AS 
    SELECT event_id FROM Event 
    WHERE status = 'OPEN' AND end_time <= v_now;

    -- Kiểm tra nếu có event hết hạn thì mới thực hiện Update
    IF (SELECT COUNT(*) FROM ExpiredEvents) > 0 THEN
        START TRANSACTION;
            -- 1) Đóng Event
            UPDATE Event e JOIN ExpiredEvents x ON e.event_id = x.event_id SET e.status = 'CLOSED';
            -- 2) Hủy vé Category
            UPDATE Category_Ticket ct JOIN ExpiredEvents x ON ct.event_id = x.event_id SET ct.status = 'INACTIVE' WHERE ct.status <> 'INACTIVE';
            -- 3) Hết hạn Ticket
            UPDATE Ticket t JOIN ExpiredEvents x ON t.event_id = x.event_id SET t.status = 'EXPIRED' WHERE t.status NOT IN ('CHECKED_IN', 'CANCELLED', 'EXPIRED');
            -- 4) Khóa Seat Layout
            UPDATE Event_Seat_Layout s JOIN ExpiredEvents x ON s.event_id = x.event_id SET s.status = 'INAVAILABLE' WHERE s.status <> 'INAVAILABLE';
        COMMIT;
    END IF;

    DROP TEMPORARY TABLE IF EXISTS ExpiredEvents;
END ;;
